description:
Verenigde Staten
Actie
92 minuten

goed

met James Remar, Mario Van Peebles en Bruce Boxleitner

Een huurmoordenaar die voor de CIA werkt, besluit voor hij stopt een laatste opdracht aan te nemen om tot de conclusie te komen 
dat hij zelf het doelwit is van zijn CIA baas. Er is maar een oplossing: doden of gedood worden...
